webpackJsonp([43914031715392],{985:function(e,t){e.exports={data:{content:{content:"<h2 id=流程>流程</h2>\n<ol>\n<li><code>git fetch</code> 確認遠端數據庫的內容</li>\n<li><code>git checkout dev</code> 從現有支線轉到開發支線</li>\n<li><code>git pull</code> 下載遠端數據庫到本地</li>\n<li>永遠使用<code>git pull</code>之後才使用<code>git push</code></li>\n<li><code>git commit -m &quot;Message&quot;</code> 很實用。。。</li>\n<li><code>git checkout -b &quot;New Branch&quot;</code> 可以直接開新支線，並切換到那條支線上</li>\n<li><code>git push origin &quot;updated-branch&quot;</code> 就可以推上去遠端數據庫</li>\n</ol>\n<h2 id=fetch>fetch</h2>\n<p>使用<code>fetch</code>指令可以避免更改本地數據庫，同時更新其他人更新遠端數據庫後的內容。</p>\n<h2 id=checkout>checkout</h2>\n<p><code>checkout</code>切換本地數據庫支線，正常情況下應該建立超過兩條支線，比如說<code>master</code>只用作發佈更新版本，<code>dev</code>用作開發。</p>\n<p>個人開發項目和與他人一同開發項目是兩回事來的。。。</p>\n",title:"Git多人合作開發工作流程",createdDate:"2017-04-01T22:22+08:00",headerImgur:null,id:"2ld01CUVG0woMyQgiSm8QK",toc:["流程","fetch","checkout"],tags:"Git"},latestPosts:{totalCount:60,edges:[{node:{title:"【網易考拉校招】部門總監面對面-直播答疑邀約（附網易內推碼B222E54）",url:"netease-kaola-live",createdDate:"2018-08-01T20:00+08:00"}},{node:{title:"Uncaught ReferenceError: regeneratorRuntime is not defined 解決方法",url:"regenerator-runtime-is-not-defined",createdDate:"2018-07-29T20:00+08:00"}},{node:{title:"關於作者",url:"about-calpa-liu",createdDate:"2018-05-01T20:00+08:00"}},{node:{title:"【方法】在直接複製貼上內容的時候，可能已經不知不覺注入了一段不可視的「空白」",url:"insert-zero-width-characters",createdDate:"2018-04-06T23:00+08:00"}},{node:{title:"知乎無限 live 數據流網站",url:"zhihu-unlimited-lives-website",createdDate:"2018-03-28T20:49+08:00"}},{node:{title:"Gatsbyjs async/await 更新報錯解決方法",url:"gatsybjs-async-await-upgrade-bug-solution",createdDate:"2018-03-21T20:00+08:00"}}]}},pathContext:{id:"2ld01CUVG0woMyQgiSm8QK"}}}});
